import SearchOptionUI from "../SearchOptionUI";

const checkboxTime = [
  "today",
  "yesterady",
  "three days ago",
  "a week ago",
  "a month ago",
  "three months ago",
  "six months ago",
  "a year ago",
];

const test = [
  { text: "today", value: 0 },
  { text: "yesterady", value: 1 },
  { text: "three days ago", value: 3 },
  { text: "a week ago", value: 7 },
  { text: "a month ago", value: 30 },
  { text: "three months ago", value: 90 },
  { text: "today", value: 0 },
];

function SearchOptionTime() {
  return <SearchOptionUI label="time" checkboxItem={checkboxTime} />;
}

export default SearchOptionTime;
